def longest_palindrome_TEMP(s):
# def longest_palindrome(s):
    def is_pal(s):
        return s == s[::-1]

    """ ENTER HERE """
    _len = len(s)
    if s == s[::-1] or _len == 1:
        return s

    long_pal = s[0]
    long = 1
    i = 0
    while i < _len - 1:
        win = s[i:]
        if is_pal(win):
            if len(win) > long:
                long = len(win)
                long_pal = win

        # check if next char is same
        # if so, scan for an even numbered palindrome
        _this = s[i]
        nxt = s[i+1]
        win = _this+nxt
        if s[i] == s[i+1]:
            if len(win) > long:
                long = len(win)
                long_pal = win
            fwd = 0
            if i < _len - 3:
                fwd = 3
            if i > 0:
                rev = 1
            else:
                rev = 0
            win = s[i-rev:i+fwd]
            while is_pal(win):
                if s[i:] == s[i] * (_len - i):
                    if len(s[i:]) > long:
                        return s[i:]
                    else:
                        return long_pal
                    return s[i:]
                if len(win) > long:
                    long = len(win)
                    long_pal = win
                fwd += 1
                rev += 1
                if (fwd > _len) or (i - rev) < 0:
                    break
                win = s[i - rev:i + fwd]


        # check if chars on either side are same as each other
        # if so, scan for an odd numbered palindrome
        if i > 0:
            win = s[i-1:i+2]
            if is_pal(win):
                if len(win) > long:
                    long = len(win)
                    long_pal = win
                fwd = 1
                rev = 1
                while fwd < _len and ((i - rev) > 0) and is_pal(win) or len(win) % 2 == 0:
                    if is_pal(win):
                        if len(win) > long:
                            long = len(win)
                            long_pal = win

                    if len(win) % 2 != 0:
                        fwd += 1
                    else:
                        rev += 1
                    win = s[i - rev:i + fwd]
                if is_pal(win):
                    if len(win) > long:
                        long = len(win)
                        long_pal = win
        i += 1
    return long_pal


